css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("https://agda.github.io/agda-stdlib/") {
  body { background-color: #002b36; color: #839496; }
  a[href]:hover { background-color: #073642; }
  .Bound { color: #2aa198; }
  .Symbol { color: #93a1a1; }
  .Argument { color: #93a1a1; }
  .Comment { color: #586e75; }
  .Function { color: #cb4b16; }
  .Field { color: #dc322f; }
  .Keyword { color: #b58900; }
  .Datatype, .PrimitiveType { color: #268bd2; } 
  .Record { color: #6c71c4; }
  .Module { color: #d33682; }
  .InductiveConstructor, .CoinductiveConstructor { color: #859900; }
  .Number, .String { color: #93a1a1; }
  .Primitive, .Postulate { color: #839496; }
}
